                return False
        return True

    words = sentence.split()
    prime_words = [word for word in words if is_prime(len(word))]
    return ' '.join(prime_words)

def simplify(x, n):
    x_num, x_den = map(int, x.split('/'))
    n_num, n_den = map(int, n.split('/'))

    result = x_num * n_num / (x_den * n_den)

    return result.is_integer()

def order_by_points(nums):
    def sum_of_digits(num):
        return sum(int(digit) for digit in str(abs(num)))

    return sorted(nums, key=lambda x: (sum_of_digits(x), nums.index(x)))

def specialFilter(nums):
    count = 0
    for num in nums:
        if num > 10 and int(str(num)[0]) % 2 != 0 and int(str(num)[-1]) % 2 != 0:
            count += 1
    return count

def get_max_triples(n):
    count = 0
    for i in range(1, n+1):
        a_i = i * i - i + 1
        for j in range(i+1, n+1):
            a_j = j * j - j + 1
            for k in range(j+1, n+1):
                a_k = k * k - k + 1
                if (a_i + a_j + a_k) % 3 == 0:
                    count += 1
    return count

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    start_idx = planets.index(planet1)
    end_idx = planets.index(planet2)
    if start_idx > end_idx:
        start_idx, end_idx = end_idx, start_idx
    return tuple(planet for planet in planets[start_idx+1:end_idx] if planet != planet1 and planet != planet2)

def x_or_y(n, x, y):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    return x if is_prime(n) else y

def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return sum(1 for c in extension if c.isupper()) - sum(1 for c in extension if c.islower())

    strongest = max(extensions, key=strength)
    return f"{class_name}.{strongest}"

def even_odd_count(num):
    even_count = len([int(digit) for digit in str(abs(num)) if int(digit) % 2 == 0])
    odd_count = len([int(digit) for digit in str(abs(num)) if int(digit) % 2 != 0])
    return (even_count, odd_count)

def int_to_mini_roman(number):
    roman_numerals = {
        1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l',
        90: 'xc', 100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'
    }
    result = ''
    for value, numeral in sorted(roman_numerals.items(), reverse=True):
        while number >= value:
            result += numeral
            number -= value
    return result.lower()

def find_max(words):
    def unique_chars(word):
        return len(set(word))

    max_unique = 0
    max_word = ""
    for word in words:
        unique = unique_chars(word)
        if unique > max_unique or (unique == max_unique and word < max_word):
            max_unique = unique
            max_word = word

    return max_word

def do_algebra(operator, operand):
    expression = str(operand[0])
    for i in range(len(operator)):
        expression += operator[i] + str(operand[i+1])
    return eval(expression)

import hashlib

def string_to_md5(text: str) -> str:
    if not text:
        return None
    return hashlib.md5(text.encode()).hexdigest()

def generate_integers(a, b):
    start = min(a, b)
    end = max(a, b)
    return [i for i in range(start, end+1) if i % 2 == 0]
